    "2016-04-02T16:32:54.031397",nt"name": "spaceborne-imaging-radar-cdb794",nt"isopen":
    false,nt"url": null,nt"notes": "Spaceborne Imaging Radar-C (SIR-C) is part
    of an imaging radar system that was flown on board two Space Shuttle flights (9
    - 20 April, 1994 and 30 September - 11 October, 1994). The U.S. Geological Survey
    (USGS) Earth Resources Observation and Science (EROS) Center distributes the C-band
    (5.8 cm) and L-band (23.5 cm) Precision (Standard) Data. All X-band (3 cm) data
    is distributed by DLR (http://www.op.dlr.de/ne-hf/SRL.html) Precision (Standard)
    Data consists of a frame image of a data segment, which represents a processed subset
    of the data swath. It contains high-resolution multifrequency and multipolarization
    data. A total of about 50 hours of data, corresponding to roughly 50 million square
    kilometers of ground coverage, was collected during each mission. The ground swath
    width varies from 15 to 90 kilometers depending on the imaging mode and incidence
    angles of the radar beams. Additional information on SIR-C is available at: http://southport.jpl.nasa.gov.",nt"license_title":
